SET standard_conforming_strings = OFF;
DROP TABLE IF EXISTS "public"."sql_statement" CASCADE;
BEGIN;
CREATE TABLE "public"."sql_statement" (    "ogc_fid" SERIAL,    CONSTRAINT "sql_statement_pk" PRIMARY KEY ("ogc_fid") );
SELECT AddGeometryColumn('public','sql_statement','geom',4326,'GEOMETRY',2);
CREATE INDEX "sql_statement_geom_geom_idx" ON "public"."sql_statement" USING GIST ("geom");
ALTER TABLE "public"."sql_statement" ADD COLUMN "osm_id" INT8;
ALTER TABLE "public"."sql_statement" ADD COLUMN "version" INTEGER;
ALTER TABLE "public"."sql_statement" ADD COLUMN "tags" JSON;
ALTER TABLE "public"."sql_statement" ADD COLUMN "changeset" INTEGER;
ALTER TABLE "public"."sql_statement" ADD COLUMN "timestamp" timestamp with time zone;
END;
COMMIT;
